import { TechshopTechsComponent } from './techshop-techs/techshop-techs.component';
import { TechshopAboutComponent } from './techshop-about/techshop-about.component';
import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: '',
    redirectTo: 'techs'
  }
  {
    path: 'techs',
    component: TechshopTechsComponent
  },
  {
    path: 'about',
    component: TechshopAboutComponent
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
